import React, { Component } from 'react';
import fire from './config/Fire';

class Backend extends Component {
    constructor(props) {
        super(props);
        this.logout = this.logout.bind(this);
    }


    logout() {
        fire.auth().signOut();
    }

    render() {
        return (<div className="container"> 
            <h1>Welcome to Backend!</h1>
            <div className="container">
            <div className="row justify-content-md-center">
       <div className="col-md-6 ">
       <form>
      <div className="form-group">
       <label htmlFor="title">Tytuł</label>
       <input value={this.state.title} onChange={this.handleChange} name="title" className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Enter email" />
       <small id="emailHelp" className="form-text text-muted">We'll never share your email with anyone else.</small>
      </div>
       <div className="form-group">
      <label htmlFor="exampleInputPassword1">treść</label>
      <input value={this.state.password} onChange={this.handleChange} type="textarea" name="text" className="form-control" id="exampleInputPassword1" placeholder="Text" />
      </div>
      <button type="submit" onClick={this.login} className="btn btn-primary">Login</button>
      <button onClick={this.add} style={{marginLeft: '25px'}} className="btn btn-success">dodaj</button>
 </form>
 </div>
 </div>
 </div>
            <button className="btn btn-success" onClick={this.logout}>Wyloguj</button>
        </div>)

    }

}

export default Backend;
